const utInput = `dabAcCaCBAcCcaDA`;
const ut1 = (input => triggerUnits(input))(`Aa`);
assert(ut1 === "");
const ut2 = (input => triggerUnits(input))(`cAaC`);
assert(ut2 === "");
const ut3 = (input => triggerUnits(input))(`abBA`);
assert(ut3 === "");
const ut4 = (input => triggerUnits(input))(`abAB`);
assert(ut4 === "abAB");
const ut5 = (input => triggerUnits(input))(`aabAAB`);
assert(ut5 === "aabAAB");
const ut6 = (input => triggerUnits(input))(utInput);
assert(ut6 === "dabCBAcaDA");
assert(ut6.length === 10);


function triggerUnits(poly) {
  let reacted = poly;
  let len = 0;
  while (len !== reacted.length) {
    len = reacted.length;
    for (let i = 0; i < reacted.length - 1; i++) {
      if (Math.abs(reacted.charCodeAt(i) - reacted.charCodeAt(i + 1)) === 32) {
        reacted = reacted.slice(0, i) + reacted.slice(i + 2);
      }
    }
  }
  return reacted;
}

